						return headers;
					}
				}, hints);
			}

			@Override
			public boolean repeatable() {
				return supportsRepeatableWrites(t);
			}
		});
	}
	else {
		writeInternal(t, type, outputMessage, hints);
		outputMessage.getBody().flush();
	}
}

